import React from "react";
import { Form } from "react-bootstrap";

const PersonalInfo = ({ handleChange }) => {
  return (
    <div className="d-flex flex-column align-items-center">
       <form    onSubmit={onSubmit}  className="form-horizontal well">
              <div  className="col-lg-12">
                <div  className="form-group">
                 
                  <input type="email" name="emails"  className="form-control" id="emails" value={emails}  onChange={(e) => setEmail(e.target.value)}  placeholder="Enter email"/>
                
                </div>
              </div>
             
              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="detail"  className="form-control" id="detail" value={detail}   onChange={(e) => setDetails(e.target.value)} />
                </div>
              </div>

              <div  className="col-lg-12">
                <div  className="form-group">
              
                  <input type="hidden" name="role"  className="form-control" id="role" value={role}   onChange={(e) => setRole(e.target.value)} />
                </div>
              </div>

              <p className='font-weight-light' style={{fontSize:"14px"}}>No account <a href="#"> Create One!</a></p>
              <p className='font-weight-light' style={{fontSize:"14px"}}> <a href="#">Can't access this account?</a></p>
              <p className='font-weight-light' style={{fontSize:"14px"}}> <a href="#"> Sign-in options</a></p>
        

             
            <button className="btn btn-sm pull-right " style={{ color: "white", backgroundColor:"#163a98", float: "right" }} id="submit-btn">Next</button>
    
          </form>
    </div>
  );
};

export default PersonalInfo;
